import{WilsonsAlgorithm}from"./class.min.mjs";import{showPage}from"/scripts/src/load-page.min.mjs";import{$}from"/scripts/src/main.min.mjs";function load(){const applet=new WilsonsAlgorithm($("#output-canvas"));$("#generate-button").addEventListener("click",run);const gridSizeInputElement=$("#grid-size-input"),maximumSpeedCheckboxElement=(applet.setInputCaps([gridSizeInputElement],[200]),applet.listenToInputElements([gridSizeInputElement],run),$("#download-button").addEventListener("click",()=>{applet.wilson.downloadFrame("wilsons-algorithm.png")}),$("#toggle-maximum-speed-checkbox")),noBordersCheckboxElement=$("#no-borders-checkbox");function run(){var gridSize=parseInt(gridSizeInputElement.value||50),maximumSpeed=maximumSpeedCheckboxElement.checked,noBorders=noBordersCheckboxElement.checked;applet.run({gridSize:gridSize,maximumSpeed:maximumSpeed,noBorders:noBorders})}showPage()}export{load};